import Navbar from "./component/Navbar";
import "./App.css"
import Intro from "./component/Intro/Intro";
import { Services } from "./component/Services/Services";
import Expirence from "./component/Expirence/Expirence";

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Intro/>
      <Services/>
      <Expirence/>
    </div>
  );
}

export default App;
